import styled from "styled-components";


function Button() {

    const thisBtn = styled.button`
        background : palevioletred;
        color: white;
        font-size: 1em;
        margin: 1em;
        padding: 0.25em 1em;
        border: 2px solid palevioletred;
        border-radius: 3px;
`;

  return (
    <thisBtn>
        Button JS Button
    </thisBtn>
  );
}

export default Button;
